import java.util.concurrent.ConcurrentLinkedQueue;

public class TokenCounterModel extends AMapReduceTracer {
    private final PropertyChangeSupport pcs = new PropertyChangeSupport(this);
    private int numThreads;
    private List<Thread> threads;
    private List<TokenCounterSlave> slaves;
    private String inputString;
    private Map<String, Integer> result;
    private ArrayBlockingQueue<KeyValue<String, Integer>> boundedBuffer;
    private ArrayList<ConcurrentLinkedQueue<KeyValue<String, Integer>>> reductionQueueList;
    private Joiner joiner;
    private TokenCounterBarrier barrier;

    public TokenCounterModel() {
        this.inputString = null;
        this.numThreads = 0;
        this.reductionQueueList = new ArrayList<>();
        this.slaves = new ArrayList<>();
        this.boundedBuffer = new ArrayBlockingQueue<>(this.BUFFER_SIZE);
    }

    public String getInputString() {
        return this.inputString;
    }

    public void clearReductionQueues() {
        for (ConcurrentLinkedQueue<KeyValue<String, Integer>> reductionQueue: reductionQueueList) {
            reductionQueue.clear();
        }
    }

    public void possiblyUnblockSlaveThreads() {
        for (int i = 0; i < this.numThreads; i++) {
            TokenCounterSlave currentSlave = this.slaves.get(i);
            currentSlave.notifySlave();
        }
    }

    public void updateInputString(String newInputString, TokenCounterView view) {
        String oldInputString = this.inputString;
        this.inputString = newInputString;
        PropertyChangeEvent updateInputStringEvent = new PropertyChangeEvent(this, "InputString",
                oldInputString, newInputString);
        view.printNotification(updateInputStringEvent);
        this.pcs.firePropertyChange(updateInputStringEvent);
    }

    public void initializeStructures() {
        this.result = new HashMap<>();
        this.boundedBuffer = new ArrayBlockingQueue<>(this.BUFFER_SIZE);
        for (ConcurrentLinkedQueue<KeyValue<String, Integer>> reductionQueue: this.reductionQueueList) {
            reductionQueue.clear();
        }
    }

    public void produceBoundedBuffer(KeyValue<String, Integer> keyValue) {
        try {
            this.traceEnqueueRequest(keyValue);
            this.boundedBuffer.put(keyValue);
            this.traceEnqueue(this.boundedBuffer);
        } catch (InterruptedException ex) {
            Tracer.error(ex.getMessage());
        }
    }

    public void endEnqueue() {
        try {
            for (int i = 0; i < this.numThreads; i++) {
                KeyValue<String, Integer> endKeyValue = new KeyValue<>(null, null);
                this.traceEnqueueRequest(endKeyValue);
                this.boundedBuffer.put(endKeyValue);
            }
        } catch (InterruptedException ex) {
            Tracer.error(ex.getMessage());
        }
    }

    public void startThreads() {
        for (Thread currentThread: this.threads) {
            if (currentThread.getState() == Thread.State.NEW) {
                currentThread.start();
            }
        }
    }

    public void problemSplit(String newInputString) {
        String[] tokens = newInputString.split(" ");
        MapperInterface<String, Integer> mapper = new Mapper();
        for (String token: tokens) {
            KeyValue<String, Integer> keyValue = mapper.map(token);
            this.produceBoundedBuffer(keyValue);
        }
        this.endEnqueue();
    }

    public void mergeResults(TokenCounterView view) {
        Map<String, Integer> oldResult = this.result;
        this.result = new HashMap<>();
        for (ConcurrentLinkedQueue<KeyValue<String, Integer>> reductionQueue : this.reductionQueueList) {
            for (KeyValue<String, Integer> keyValues: reductionQueue) {
                String key = keyValues.getKey();
                Integer value = keyValues.getValue();
                this.result.put(key, value);
            }
        }
        PropertyChangeEvent updateResultEvent = new PropertyChangeEvent(this, "Result",
                oldResult, this.result);
        view.printNotification(updateResultEvent);
        this.pcs.firePropertyChange(updateResultEvent);
    }

    public void setInputString(String newInputString, TokenCounterView view) {
        this.updateInputString(newInputString, view);
        this.initializeStructures();
        this.clearReductionQueues();
        this.startThreads();
        this.possiblyUnblockSlaveThreads();
        this.problemSplit(newInputString);
        this.joiner.join();
        this.mergeResults(view);
    }

    public void addPropertyChangeListener(PropertyChangeListener aListener) {
        this.pcs.addPropertyChangeListener(aListener);
    }

    public int getNumThreads() {
        return this.numThreads;
    }

    public TokenCounterBarrier getBarrier() {
        return this.barrier;
    }

    public ArrayBlockingQueue<KeyValue<String, Integer>> getBoundedBuffer() {
        return this.boundedBuffer;
    }

    public Joiner getJoiner() {
        return this.joiner;
    }

    public ArrayList<ConcurrentLinkedQueue<KeyValue<String, Integer>>> getReductionQueueList() {
        return this.reductionQueueList;
    }

    public Map<String, Integer> getResult() {
        return this.result;
    }

    public void updateThreads(int numThreads, TokenCounterView view) {
        List<Thread> oldThreads = this.threads;
        this.joiner = new TokenCounterJoiner(numThreads);
        this.barrier = new TokenCounterBarrier(numThreads);
        this.threads = new ArrayList<>(numThreads);
        for (int i = 0; i < numThreads; i++) {
            TokenCounterSlave slave = new TokenCounterSlave(i, this);
            this.slaves.add(slave);
            Thread newThread = new Thread(slave, "Slave" + i);
            this.threads.add(newThread);
            ConcurrentLinkedQueue<KeyValue<String, Integer>> reductionQueue = new ConcurrentLinkedQueue<>();
            this.reductionQueueList.add(reductionQueue);
        }
        PropertyChangeEvent updateThreadsEvent = new PropertyChangeEvent(this, "Threads",
                oldThreads, this.threads);
        view.printNotification(updateThreadsEvent);
        this.pcs.firePropertyChange(updateThreadsEvent);
    }

    public void interruptThreads() {
        for (int i = 0; i < this.numThreads; i++) {
            this.slaves.get(i).signalQuit();
            this.threads.get(i).interrupt();
        }
    }

    public void setNumThreads(int numThreads, TokenCounterView view) {
        int oldNumThreads = this.numThreads;
        this.numThreads = numThreads;
        PropertyChangeEvent updateInputStringEvent = new PropertyChangeEvent(this, "NumThreads",
                oldNumThreads, numThreads);
        view.printNotification(updateInputStringEvent);
        this.pcs.firePropertyChange(updateInputStringEvent);
        this.updateThreads(numThreads, view);
    }


    @Override
    public String toString() {
        return AMapReduceTracer.MODEL;
    }
}

package comp533.reducer;

import comp533.keyValue.KeyValue;
import comp533.keyValue.KeyValueInterface;
import gradingTools.comp533s19.assignment0.AMapReduceTracer;

import java.util.HashMap;
import java.util.List;
import java.util.Map;


public class Reducer extends AMapReduceTracer implements ReducerInterface<String, Integer>{
	public Map<String, Integer> reduce(List<KeyValue<String, Integer>> argList) {
        Map<String, Integer> map = new HashMap<>();
        for (KeyValue<String, Integer> keyValue: argList) {
            String key = keyValue.getKey();
            Integer value = keyValue.getValue();
            if (map.containsKey(key)) {
                Integer sum = map.get(key);
                sum += value;
                map.put(key, sum);
            } else {
                map.put(key, value);
            }
        }
        this.traceReduce(argList, map);
        return map;
    }
}

package comp533.slave;

import comp533.barrier.TokenCounterBarrier;
import comp533.joiner.Joiner;
import comp533.keyValue.KeyValue;
import comp533.model.TokenCounterModel;
import comp533.partitioner.TokenCounterPartitioner;
import comp533.partitioner.TokenCounterPartitionerFactory;
import comp533.reducer.Reducer;
import comp533.reducer.ReducerFactory;
import comp533.reducer.ReducerInterface;
import gradingTools.comp533s19.assignment0.AMapReduceTracer;
import util.trace.Tracer;

import java.util.ArrayList;
import java.util.List;
import java.util.Map;
import java.util.concurrent.ArrayBlockingQueue;
import java.util.concurrent.ConcurrentLinkedQueue;

public class TokenCounterSlave extends AMapReduceTracer implements SlaveInterface {
    private int threadId;
    private List<KeyValue<String, Integer>> keyValueList;
    private TokenCounterModel model;

    public TokenCounterSlave(int threadId, TokenCounterModel model) {
        this.threadId = threadId;
        this.model = model;
        this.keyValueList = new ArrayList<>();
    }

    public synchronized void notifySlave() {
        this.synchronizedNotify();
    }

    public void splitBoundedBuffer() {
        ArrayBlockingQueue<KeyValue<String, Integer>> boundedBuffer = this.model.getBoundedBuffer();
        try {
            while(true) {
                this.traceDequeueRequest(boundedBuffer);
                KeyValue<String, Integer> consumedItem = boundedBuffer.take();
                if (consumedItem.getKey() == null) {
                    break;
                }
                this.traceDequeue(consumedItem);
                this.keyValueList.add(consumedItem);
            }
        } catch (InterruptedException ex) {
            Tracer.error(ex.getMessage());
        }
    }

    public Map<String, Integer> reduceList(ReducerInterface<String, Integer> reducer, List<KeyValue<String, Integer>> list) {
        return reducer.reduce(list);
    }

    private ArrayList<ConcurrentLinkedQueue<KeyValue<String, Integer>>> splitReduction(Map<String, Integer> partiallyReducedMap) {
        ArrayList<ConcurrentLinkedQueue<KeyValue<String, Integer>>> reduceQueueList = this.model.getReductionQueueList();
        TokenCounterPartitioner partitioner = TokenCounterPartitionerFactory.getPartitioner();
        for (Map.Entry<String, Integer> entry: partiallyReducedMap.entrySet()) {
            String key = entry.getKey();
            Integer value = entry.getValue();
            int numOfPartitions = reduceQueueList.size();
            int index = partitioner.getPartition(key, value, numOfPartitions);
            this.tracePartitionAssigned(key, value, index, numOfPartitions);
            KeyValue<String, Integer> keyValue = new KeyValue<>(key, value);
            reduceQueueList.get(index).add(keyValue);
        }
        return reduceQueueList;
    }

    public void signalQuit() {
        this.traceQuit();
    }

    @Override
    public void run() {
        TokenCounterBarrier tokencounterBarrier = this.model.getBarrier();
        ReducerInterface<String, Integer> reducer = ReducerFactory.getReducer();
        while(true) {
            Map<String, Integer> originalMap = this.model.getResult();
            this.splitBoundedBuffer();
            Map<String, Integer> partiallyReducedMap = this.reduceList(reducer, this.keyValueList);
            ArrayList<ConcurrentLinkedQueue<KeyValue<String, Integer>>> reductionQueueList = this.splitReduction(partiallyReducedMap);
            tokencounterBarrier.barrier();
            this.traceSplitAfterBarrier(this.threadId, reductionQueueList);
            for (ConcurrentLinkedQueue<KeyValue<String, Integer>> reductionQueue : reductionQueueList) {
                List<KeyValue<String, Integer>> keyValues = List.copyOf(reductionQueue);
                this.reduceList(reducer, keyValues);
            }
            Joiner joiner = this.model.getJoiner();
            joiner.finished();
            this.traceAddedToMap(originalMap, this.model.getResult());
            try {
                this.synchronizedWait();
            } catch (InterruptedException ex) {
                Tracer.error(ex.getMessage());
                break;
            }
        }
    }
}

package comp533.model;

import gradingTools.comp533s19.assignment0.AMapReduceTracer;

import java.beans.PropertyChangeEvent;
import java.beans.PropertyChangeSupport;
import java.util.Arrays;
import java.util.List;
import java.util.Map;

import comp533.keyValue.KeyValue;
//import comp533.mapper.Mapper;
import comp533.mapper.MapperInterface;
import comp533.mapper.SumMapper;
import comp533.reducer.Reducer;
import comp533.reducer.ReducerInterface;
import comp533.view.TokenCounterView;

public class SumModel extends AMapReduceTracer implements ModelInterface {
	private String inputString;
    private Map<String, Integer> result;
    private final PropertyChangeSupport propertyChangeSupport = new PropertyChangeSupport(this);
    
    public SumModel() {
    	this.inputString = null;
    	this.result = null;
    }

	public static MapperInterface<String, Integer> getSumMapper() {
    	
//    	MapperInterface<String, Integer> mapper = new SumMapper<String, Integer>();
        
//    	AMapReduceTracer.traceMapperChange(SumModel.class, mapper);
    	return new SumMapper<String, Integer>();
    }
    
    public void setInputString(final String newInputString, final TokenCounterView view) {
        final String oldInputString = this.inputString;
        this.inputString = newInputString;
        
        //create and send event to view
        final PropertyChangeEvent SetInputStringEvent = new PropertyChangeEvent(this, "InputString",
                oldInputString, newInputString);
        view.tracePropertyChange(SetInputStringEvent);
        this.propertyChangeSupport.firePropertyChange(SetInputStringEvent);
        this.computeResultMapReduce(newInputString, view);
    }
    

    
    public void computeResultMapReduce(final String thisInputString, final TokenCounterView view) {
    	final Map<String, Integer> oldResult = this.result;
    	
        final String[] tokens = thisInputString.split(" ");
        final List<String> tokensList = Arrays.asList(tokens);
        final MapperInterface<String, Integer> mappedKeyValue = new SumMapper<String, Integer>();
        final List<KeyValue<String, Integer>> resultMap = mappedKeyValue.map(tokensList);
        final ReducerInterface<String, Integer> reducer = new Reducer();
        this.result = reducer.reduce(resultMap);
        final PropertyChangeEvent updateResultEvent = new PropertyChangeEvent(this, "Result",
                oldResult, this.result);
        view.tracePropertyChange(updateResultEvent);
        this.propertyChangeSupport.firePropertyChange(updateResultEvent);
    }
    
    public String getInputString() {
    	return this.inputString;
    }
	    
    public Map<String, Integer> getResult() {
        return this.result;
    }
    
    @Override
    public String toString() {
    	return AMapReduceTracer.MODEL;
    }
}

